    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n < 0:
        raise ValueError('Argument n should be a non-negative integer')
    return '{0}{1}'.format(''.join(str(i + 1) for i in range(n)),'')

